import './style.css'
import {Form,FormGroup,Label,Input,Button,Container,DropdownItem,ButtonDropdown,DropdownToggle,DropdownMenu} from 'reactstrap';

const form =()=>{
  
      return (

<div className="wrapper">
      <div className="form-signin">
      <ButtonDropdown
  toggle={function noRefCheck(){}}
  color="info"
>
  <DropdownToggle caret>
    State
  </DropdownToggle>
  <DropdownMenu>
    <DropdownItem>
      NSW
    </DropdownItem>
    <DropdownItem disabled>
      Action
    </DropdownItem>
    <DropdownItem>
      Another Action
    </DropdownItem>
    <DropdownItem divider />
    <DropdownItem>
      Another Action
    </DropdownItem>
  </DropdownMenu>
</ButtonDropdown>
      <Input
          // onChange={() => handleChange(event)}
          // value={product.name}
          type="text"
          //className="form-control"
          name="name"
          placeholder="product name"
        />
        <Input
          // onChange={() => handleChange(event)}
          // value={product.price}
          type="text"
          //className="form-control"
          name="price"
          placeholder="price"
        />
        <Input
          // onChange={() => handleChange(event)}
          // value={product.description}
          type="text"
          // className="form-control"
          name="description"
          placeholder="description"
        />
        <button
          className="btn btn-lg btn-primary btn-block"
          // onClick={() => handleSubmit()}
        >
          Submit
        </button>
      </div>
      </div>
    )
}
export default form
